function loadData(){var g=$("body");var b=$("#results-header");var a=$("#results-articles");var e=$("#greeting");a.text("");b.text("");var h="98270563";var d="";var f="https://zkillboard.com/api/corporationID/"+h+"/";var c=setTimeout(function(){a.text("Failed to get kill data")},8000);$.ajax({url:f,dataType:"jsonp",success:function(l){var q=l;console.log(q);for(var m=0;m<q.length;m++){articleStr=q[m];var n="http://imageserver.eveonline.com/Corporation/"+articleStr.victim.corporationID+"_32.png";var o="http://imageserver.eveonline.com/Character/"+articleStr.victim.characterID+"_32.jpg";var s=[];for(var k=0;k<articleStr.attackers.length;k++){s[k]={pilotkb:"https://zkillboard.com/character/"+articleStr.attackers[k].characterID+"/",corpPic:"http://imageserver.eveonline.com/Corporation/"+articleStr.attackers[k].corporationID+"_32.png",corp:articleStr.attackers[k].corporationName,pilot:articleStr.attackers[k].characterName}}var j="http://zkillboard.com/kill/"+articleStr.killID+"/";a.append('<ul><li>Victim: <img src="'+o+'"><img src="'+n+'">   <a href="'+j+'">'+articleStr.victim.characterName+"</a><br> Corporation: "+articleStr.victim.corporationName+"<br>");for(var r=0;r<s.length;r++){a.append('  <img src="'+s[r].corpPic+'">  '+s[r].corp+'  <a href="'+s[r].pilotkb+'">'+s[r].pilot+"</a><br>")}var p=Number(articleStr.zkb.totalValue).toLocaleString("en");a.append(" Value: "+p+" ISK  Points: "+articleStr.zkb.points+"</li></ul>")}clearTimeout(c)}});return false}$("#form-container").submit(loadData);function remove(a){return(elem=document.getElementById(a)).parentNode.removeChild(elem)};